import logo from './Images/penguin-logo.png';
import './App.css';
import SignInForm from './Components/SignInForm';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="penguin-logo" alt="logo" />
        <p>
          Trade Penguin
        </p>
        <SignInForm />

      </header>
    </div>
  );
}

export default App;
